class IconContext {
  private icons: Array<{
    id: string;
    type: string;
    x: number;
    y: number;
    size: number;
    color: string;
  }> = [];
  
  addIcon(type: string, x: number, y: number, size: number, color: string): string {
    const id = Math.random().toString(36).substr(2, 9);
    this.icons.push({ id, type, x, y, size, color });
    return id;
  }
}`,language:"typescript"}),c.jsx(gt,{title:"",code:`// 
